package Day5;

import java.util.Arrays;
import java.util.LinkedList;
import java.util.List;

public class AlchemicalReduction {

    String polymer;

    public AlchemicalReduction() {
        this.polymer = "";
    }

    public int play() {
        List list = new LinkedList<String>(Arrays.asList(this.polymer.split("")));

        //TODO Iterate
        int index = 0;
            if(compare(list.get(index), list.get(index+1))) {
                list.remove(index);
                list.remove(index+1);
            }
        return list.size();
    }

    public Boolean compare(Object current, Object next) {
        return current.equals(next.toString().toUpperCase()) || next.equals(current.toString().toUpperCase());
    }

    public static void main(String[] args) {
        AlchemicalReduction alc = new AlchemicalReduction();
    }

}
